INSERT INTO `articles_lang` (`id`, `fk_article`, `contenue`, `fk_lang`, `titre`, `description`, `miniature`) VALUES
(1, 1, '<div>Avez-vous entendu celui sur l\'homme qui était convaincu qu\'il était mort? C\'est un classique, et comme les 99 autres blagues de ce livre, vous apprécierez la lecture et encore plus la narration. Il y a aussi celui sur Einstein et son chauffeur. La femme qui est partie en vacances et a laissé son chat avec sa sœur. Le fermier avec le cochon à trois pattes. Mais quand le rire s\'installe, il se passe autre chose. Entre les mains magistrales des frères Javna, chaque blague révèle des informations sur le comportement humain - et des conseils pour mettre ces idées en action - que vous voudrez partager aussi facilement que les blagues elles-mêmes.</div>', 1, 'La vie est une blague', 'test 56256fd', 'pic/upload/miniature/img_5fa3737c3dd36.jpg'),
(2, 1, 'Did you hear the one about the man who was convinced he was dead?\r\n\r\nIt\'s a classic, and like the 99 other joke in this book, you\'ll delight in the reading and even more in the telling. There\'s also the one about Einstein and his chauffeur. The woman who went on vacation and left her pet cat with her sister. The farmer with the three-legged pig.\r\n\r\nBut when the laughter settles, something else happens. In the masterful hands of the Javna brothers, each joke reveals insights into human behavior--and tips for putting that insight into action--that you\'ll want to share as readily as the jokes themselves.', 2, 'Life Is a Joke', NULL, NULL);

